INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("リン", "2030/12/17 14:59:59", "あたしだって\nやるときはやるよ！", 10040, 0.0, 1, "2020/04/30 12:00:00", 24, 0, 1, 24001, 0.0, 102601, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("リン", "2030/12/17 14:59:59", "ふぅ…\nこれであたしの仕事は\n終わりだね", 10040, 0.0, 1, "2020/04/30 12:00:00", 24, 1, 1, 24002, 0.0, 102601, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("リン", "2030/12/17 14:59:59", "終わった終わった\n一人でもなんとか\nなるもんだね", 10040, 0.0, 1, "2020/04/30 12:00:00", 24, 2, 1, 24003, 0.0, 102601, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("リン", "2030/12/17 14:59:59", "やったね！\nこれでようやく\nサボれるよ…", 10040, 0.0, 2, "2020/04/30 12:00:00", 24, 3, 2, 24004, 0.0, 102601, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("リン", "2030/12/17 14:59:59", "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 10040, 0.0, 1, "2020/04/30 12:00:00", 24, 4, 1, 24005, 0.0, 102601, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("リン", "2030/12/17 14:59:59", "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 10040, 0.0, 2, "2020/04/30 12:00:00", 24, 5, 2, 24006, 0.0, 102601, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("リン", "2030/12/17 14:59:59", "あたしも意外と\nやるもんでしょ？", 10040, 0.0, 2, "2020/04/30 12:00:00", 24, 6, 2, 24007, 0.0, 102601, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("リン", "2030/12/17 14:59:59", "疲れた…\nねずみの逃げ足\n速すぎるよ…", 10040, 0.0, 4, "2020/04/30 12:00:00", 24, 7, 4, 24008, 0.0, 102601, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("リン", "2030/12/17 14:59:59", "このままじゃ\nまっひ～に\n叱られちゃうよ", 10040, 0.0, 4, "2020/04/30 12:00:00", 24, 8, 4, 24009, 0.0, 102601, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("リン", "2030/12/17 14:59:59", "まじめに\nやったんだけどな…\n悔しいな～", 10040, 0.0, 4, "2020/04/30 12:00:00", 24, 9, 4, 24010, 0.0, 102601, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("リン", "2030/12/17 14:59:59", "やられた…\nねずみって意外と\nてごわいね", 10040, 0.0, 4, "2020/04/30 12:00:00", 24, 10, 4, 24011, 0.0, 102601, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("リン", "2030/12/17 14:59:59", "おのれ～\nあたしのチーズを\n盗みやがって～！", 10040, 0.0, 4, "2020/04/30 12:00:00", 24, 11, 4, 24012, 0.0, 102601, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("リン", "2030/12/17 14:59:59", "疲れた…\nけど、次こそは\n守り抜くよ…", 10040, 0.0, 4, "2020/04/30 12:00:00", 24, 12, 1, 24013, 0.0, 102601, 1.81);
